// Get base price and tax rates
const basePrice = context.item.data?.price?.[0]?.base_price || 0;
const exciseTaxRate = parseFloat(context.item.data?.price?.[0]?.tax_breakdown?.state_excise_tax?.rate_percentage) || 0;
const salesTaxRate = parseFloat(context.item.data?.price?.[0]?.tax_breakdown?.state_sales_tax?.rate_percentage) || 0;
const localCannabisTaxRate = parseFloat(context.item.data?.price?.[0]?.tax_breakdown?.local_cannabis_tax?.rate_percentage) || 0;
const cannibleFeeRate = parseFloat(context.item.data?.price?.[0]?.cannible_fee?.rate_percentage) || 0;

// Calculate taxes
const exciseTax = basePrice * (exciseTaxRate / 100);
const localCannabisTax = basePrice * (localCannabisTaxRate / 100);

// Subtotal before sales tax
const subtotalBeforeSalesTax = basePrice + exciseTax + localCannabisTax;

// Sales tax
const salesTax = subtotalBeforeSalesTax * (salesTaxRate / 100);

// Subtotal
const subtotal = subtotalBeforeSalesTax + salesTax;

// Cannible fee
const cannibleFee = subtotal * (cannibleFeeRate / 100);

// Final total
const finalTotal = subtotal + cannibleFee;

// Return formatted price string (e.g., "23.10")
return finalTotal.toFixed(2);

